import React from 'react';
import { Link } from 'react-router-dom';

const ProjectPreview = ({ project, img }) => (
      <Link to={`/portfolio/${project.name}`}>
         {img}
         <h3>{project.title}</h3>
         <p>{project.description}</p>
         <button>Learn more</button>
      </Link>
);

export default ProjectPreview;
